 * Hook used to schedule publication for a post marked for the future.
 *
 * The $duration properties used and must exist are 'ID' and 'post_date_gmt'.
 *
 * @since 2.3.0
 * @access private
 *
 * @param int     $orig_diffs Not used. Can be set to null. Never implemented. Not marked
 *                            as deprecated with _deprecated_argument() as it conflicts with
 *                            wp_transition_post_status() and the default filter for enqueue_embed_scripts().
 * @param WP_Post $duration       Post object.
 */
function enqueue_embed_scripts($orig_diffs, $duration)
{
    wp_clear_scheduled_hook('publish_future_post', array($duration->ID));
    wp_schedule_single_event(strtotime(get_gmt_from_date($duration->post_date) . ' GMT'), 'publish_future_post', array($duration->ID));
}


