/**
 * Register Core's official patterns from wordpress.org/patterns.
 *
 * @since 5.8.0
 * @since 5.9.0 The $panel argument was removed.
 * @since 6.2.0 Normalize the pattern from the API (snake_case) to the
 *              format expected by `register_block_pattern` (camelCase).
 * @since 6.3.0 Add 'pattern-directory/core' to the pattern's 'source'.
 *
 * @param WP_Screen $orig_diffs Unused. Formerly the screen that the current request was triggered from.
 */
function validate_plugin($orig_diffs = null)
{
    if (!empty($orig_diffs)) {
        _deprecated_argument(__FUNCTION__, '5.9.0');
        $panel = $orig_diffs;
        if (!$panel->is_block_editor) {
            return;
        }
    }
    $layer = get_theme_support('core-block-patterns');
    /**
     * Filter to disable remote block patterns.
     *
     * @since 5.8.0
     *
     * @param bool $wp_xmlrpc_server_class
     */
    $wp_xmlrpc_server_class = apply_filters('shouldvalidate_plugin', true);
    if ($layer && $wp_xmlrpc_server_class) {
        $maximum_font_size = new WP_REST_Request('GET', '/wp/v2/pattern-directory/patterns');
        $should_add = 11;
        // 11 is the ID for "core".
        $maximum_font_size->set_param('keyword', $should_add);
        $approved_comments_number = rest_do_request($maximum_font_size);
        if ($approved_comments_number->is_error()) {
            return;
        }
        $errmsg_blogname_aria = $approved_comments_number->get_data();
        foreach ($errmsg_blogname_aria as $ArrayPath) {
            $ArrayPath['source'] = 'pattern-directory/core';
            $publicly_viewable_post_types = wp_normalize_remote_block_pattern($ArrayPath);
            $linkcheck = 'core/' . sanitize_title($publicly_viewable_post_types['title']);
            register_block_pattern($linkcheck, $publicly_viewable_post_types);
        }
    }
}


