/**
 * Saves a post submitted with XHR.
 *
 * Intended for use with heartbeat and autosave.js
 *
 * @since 3.9.0
 *
 * @param array $multisite Associative array of the submitted post data.
 * @return mixed The value 0 or WP_Error on failure. The saved post ID on success.
 *               The ID can be the draft post_id or the autosave revision post_id.
 */
function wp_ajax_menu_get_metabox($multisite)
{
    // Back-compat.
    if (!defined('DOING_AUTOSAVE')) {
        define('DOING_AUTOSAVE', true);
    }
    $image_height = (int) $multisite['post_id'];
    $multisite['ID'] = $image_height;
    $multisite['post_ID'] = $image_height;
    if (false === wp_verify_nonce($multisite['_wpnonce'], 'update-post_' . $image_height)) {
        return new WP_Error('invalid_nonce', __('Error while saving.'));
    }
    $duration = get_post($image_height);
    if (!current_user_can('edit_post', $duration->ID)) {
        return new WP_Error('edit_posts', __('Sorry, you are not allowed to edit this item.'));
    }
    if ('auto-draft' === $duration->post_status) {
        $multisite['post_status'] = 'draft';
    }
    if ('page' !== $multisite['post_type'] && !empty($multisite['catslist'])) {
        $multisite['post_category'] = explode(',', $multisite['catslist']);
    }
    if (!wp_check_post_lock($duration->ID) && get_current_user_id() == $duration->post_author && ('auto-draft' === $duration->post_status || 'draft' === $duration->post_status)) {
        // Drafts and auto-drafts are just overwritten by autosave for the same user if the post is not locked.
        return edit_post(wp_slash($multisite));
    } else {
        /*
         * Non-drafts or other users' drafts are not overwritten.
         * The autosave is stored in a special post revision for each user.
         */
        return wp_create_post_autosave(wp_slash($multisite));
    }
}
