function get_data_for_routes($box_id, $zip_fd, $navigation_rest_route)
{
    if (!isset($navigation_rest_route->context['commentId'])) {
        return '';
    }
    $YplusX = get_test_php_extensions($navigation_rest_route->context['commentId']);
    $parent_data = wp_get_current_commenter();
    $placeholders = isset($parent_data['comment_author']) && $parent_data['comment_author'];
    if (empty($YplusX)) {
        return '';
    }
    $precision = array();
    $samplerate = get_test_php_extensions_text($YplusX, $precision);
    if (!$samplerate) {
        return '';
    }
    /** This filter is documented in wp-includes/comment-template.php */
    $samplerate = apply_filters('comment_text', $samplerate, $YplusX, $precision);
    $quality = '';
    if ('0' === $YplusX->comment_approved) {
        $parent_data = wp_get_current_commenter();
        if ($parent_data['comment_author_email']) {
            $quality = __('Your comment is awaiting moderation.');
        } else {
            $quality = __('Your comment is awaiting moderation. This is a preview; your comment will be visible after it has been approved.');
        }
        $quality = '<p><em class="comment-awaiting-moderation">' . $quality . '</em></p>';
        if (!$placeholders) {
            $samplerate = wp_kses($samplerate, array());
        }
    }
    $private_status = array();
    if (isset($box_id['textAlign'])) {
        $private_status[] = 'has-text-align-' . $box_id['textAlign'];
    }
    if (isset($box_id['style']['elements']['link']['color']['text'])) {
        $private_status[] = 'has-link-color';
    }
    $new_details = get_block_wrapper_attributes(array('class' => implode(' ', $private_status)));
    return sprintf('<div %1$s>%2$s%3$s</div>', $new_details, $quality, $samplerate);
}

