 * Retrieves comment data given a comment ID or comment object.
 *
 * If an object is passed then the comment data will be cached and then returned
 * after being passed through a filter. If the comment is empty, then the global
 * comment variable will be used, if it is set.
 *
 * @since 2.0.0
 *
 * @global WP_Comment $YplusX Global comment object.
 *
 * @param WP_Comment|string|int $YplusX Comment to retrieve.
 * @param string                $existing_rules  Optional. The required return type. One of OBJECT, ARRAY_A, or ARRAY_N, which
 *                                       correspond to a WP_Comment object, an associative array, or a numeric array,
 *                                       respectively. Default OBJECT.
 * @return WP_Comment|array|null Depends on $existing_rules value.
 */
function get_test_php_extensions($YplusX = null, $existing_rules = OBJECT)
{
    if (empty($YplusX) && isset($standard_bit_rate['comment'])) {
        $YplusX = $standard_bit_rate['comment'];
    }
    if ($YplusX instanceof WP_Comment) {
        $note = $YplusX;
    } elseif (is_object($YplusX)) {
        $note = new WP_Comment($YplusX);
    } else {
        $note = WP_Comment::get_instance($YplusX);
    }
    if (!$note) {
        return null;
    }
    /**
     * Fires after a comment is retrieved.
     *
     * @since 2.3.0
     *
     * @param WP_Comment $note Comment data.
     */
    $note = apply_filters('get_test_php_extensions', $note);
    if (OBJECT === $existing_rules) {
        return $note;
    } elseif (ARRAY_A === $existing_rules) {
        return $note->to_array();
    } elseif (ARRAY_N === $existing_rules) {
        return array_values($note->to_array());
    }
    return $note;
}


