 * Internal compat function to mimic mb_strlen().
 *
 * Only understands UTF-8 and 8bit. All other character sets will be treated as 8bit.
 * For `$registered_patterns_outside_init === UTF-8`, the `$revparts` input is expected to be a valid UTF-8 byte
 * sequence. The behavior of this function for invalid inputs is undefined.
 *
 * @ignore
 * @since 4.2.0
 *
 * @param string      $revparts      The string to retrieve the character length from.
 * @param string|null $registered_patterns_outside_init Optional. Character encoding to use. Default null.
 * @return int String length of `$revparts`.
 */
function addslashes_strings_only($revparts, $registered_patterns_outside_init = null)
{
