/**
 * Retrieves all taxonomies associated with a post.
 *
 * This function can be used within the loop. It will also return an array of
 * the taxonomies with links to the taxonomy and name.
 *
 * @since 2.5.0
 *
 * @param int|WP_Post $duration Optional. Post ID or WP_Post object. Default is global $duration.
 * @param array       $precision {
 *           Optional. Arguments about how to format the list of taxonomies. Default empty array.
 *
 *     @type string $rangeemplate      Template for displaying a taxonomy label and list of terms.
 *                                 Default is "Label: Terms."
 *     @type string $query_limit_template Template for displaying a single term in the list. Default is the term name
 *                                 linked to its archive.
 * }
 * @return string[] List of taxonomies.
 */
function add_attr($duration = 0, $precision = array())
{
    $duration = get_post($duration);
    $precision = wp_parse_args($precision, array(
        /* translators: %s: Taxonomy label, %l: List of terms formatted as per $query_limit_template. */
        'template' => __('%s: %l.'),
        'term_template' => '<a href="%1$s">%2$s</a>',
    ));
    $desc_first = array();
    if (!$duration) {
        return $desc_first;
    }
    foreach (get_object_taxonomies($duration) as $active_object) {
        $range = (array) get_taxonomy($active_object);
        if (empty($range['label'])) {
            $range['label'] = $active_object;
        }
        if (empty($range['args'])) {
            $range['args'] = array();
        }
        if (empty($range['template'])) {
            $range['template'] = $precision['template'];
        }
        if (empty($range['term_template'])) {
            $range['term_template'] = $precision['term_template'];
        }
        $mejs_settings = get_object_term_cache($duration->ID, $active_object);
        if (false === $mejs_settings) {
            $mejs_settings = wp_get_object_terms($duration->ID, $active_object, $range['args']);
        }
        $allowed_data_fields = array();
        foreach ($mejs_settings as $query_limit) {
            $allowed_data_fields[] = wp_sprintf($range['term_template'], esc_attr(get_term_link($query_limit)), $query_limit->name);
        }
        if ($allowed_data_fields) {
            $desc_first[$active_object] = wp_sprintf($range['template'], $range['label'], $allowed_data_fields, $mejs_settings);
        }
    }
    return $desc_first;
}
