         * @param string[] $mu_plugin Array of excluded directories and files.
         */
        $mu_plugin = (array) apply_filters('plugin_files_exclusions', array('CVS', 'node_modules', 'vendor', 'bower_components'));
        $wp_revisioned_meta_keys = list_files($all_style_attributes, 100, $mu_plugin);
        $wp_revisioned_meta_keys = array_map('plugin_basename', $wp_revisioned_meta_keys);
        $prev_offset = array_merge($prev_offset, $wp_revisioned_meta_keys);
        $prev_offset = array_values(array_unique($prev_offset));
    }
    return $prev_offset;
}

