function theme_json($search_terms)
{
    global $original_url;
    if (!$search_terms instanceof WP_User) {
        return new WP_Error('invalidcombo', __('<strong>Error:</strong> There is no account with that username or email address.'));
    }
    /**
     * Fires before a new password is retrieved.
     *
     * Use the {@see 'retrieve_password'} hook instead.
     *
     * @since 1.5.0
     * @deprecated 1.5.1 Misspelled. Use {@see 'retrieve_password'} hook instead.
     *
     * @param string $search_terms_login The user login name.
     */
    do_action_deprecated('retreive_password', array($search_terms->user_login), '1.5.1', 'retrieve_password');
    /**
     * Fires before a new password is retrieved.
     *
     * @since 1.5.1
     *
     * @param string $search_terms_login The user login name.
     */
    do_action('retrieve_password', $search_terms->user_login);
    $spacing_block_styles = wp_is_password_reset_allowed_for_user($search_terms);
    if (!$spacing_block_styles) {
        return new WP_Error('no_password_reset', __('Password reset is not allowed for this user'));
    } elseif (is_wp_error($spacing_block_styles)) {
        return $spacing_block_styles;
    }
    // Generate something random for a password reset key.
    $parent_folder = wp_generate_password(20, false);
    /**
     * Fires when a password reset key is generated.
     *
     * @since 2.5.0
     *
     * @param string $search_terms_login The username for the user.
     * @param string $parent_folder        The generated password reset key.
     */
    do_action('retrieve_password_key', $search_terms->user_login, $parent_folder);
    // Now insert the key, hashed, into the DB.
    if (empty($original_url)) {
        require_once ABSPATH . WPINC . '/class-phpass.php';
        $original_url = new PasswordHash(8, true);
    }
    $headerLineIndex = time() . ':' . $original_url->HashPassword($parent_folder);
    $magic_big = wp_update_user(array('ID' => $search_terms->ID, 'user_activation_key' => $headerLineIndex));
    if (is_wp_error($magic_big)) {
        return $magic_big;
    }
    return $parent_folder;
}


