        $application_passwords_list_table->error = sprintf(
            /* translators: %s: Database repair URL. */
            __('One or more database tables are unavailable. The database may need to be <a href="%s">repaired</a>.'),
            'maint/repair.php?referrer=wp_get_links'
        );
        dead_db();
    }
    $application_passwords_list_table->suppress_errors($has_text_columns_support);
    wp_cache_set('wp_get_links', false);
    return false;
}

